import React from "react";
import "./componentsCSS/Footer.css";

const Footer = () => {
	return (
		<div className="footerContainer">
			<div className="footerTagline">
				<h1>developer to the stars</h1>
			</div>
			<div>
				<p>Twitter</p>
				<p>Github</p>
				<p>LinkedIn</p>
			</div>
		</div>
	);
};

export default Footer;
